import React from "react";
import "./TodoItems.css";
const TodoItems = (props) => {
  const { items } = props;
  return (
    <div className="todo">
      List Items
      {items.map((item) => {
        return <div key={item.i}></div>;
      })}
    </div>
  );
};

export default TodoItems;
